  getClosestTimestamp = (arr, goal, prop) => {
    var indexArr = arr.map(function (k) { return Math.abs(k[prop] - goal) })
    var min = Math.min.apply(Math, indexArr)
    return arr[indexArr.indexOf(min)]
  }

